    <div className="App">
      <h1>Course Scores App</h1>

      <div className="form">
        <label>Course Code:</label>
        <input type="text" name="courseCode" />
        <label>Course Name:</label>
        <input type="text" name="courseName" />

        <button>Submit</button>
      </div>
    </div>
  )
}

